    false,nt"url": null,nt"notes": "AML_POLY, the predecessor of COAL_AML_FEATURES_IN,
    is a 1:24,000-scale polygon-based ESRI ArcView shapefile that shows the locations
    and extents of Abandoned Mine Lands (AML) sites and site features in the coal region
    of Indiana. AML_POLY includes all Indiana sites listed on the federal AML site inventory
    by personnel of the Abandoned Mine Lands program of the Indiana Department of Natural
    Resources, Division of Reclamation. COAL_AML_FEATURES_IN includes attributes that
    allow the polygons to be differentiated based on site type, site number, and site
    feature type.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
